      "cell_type": "code",
      "source": [
        "df <- read.csv(\"Landslide_Factors_IRAN.csv\")"
      ],
      "metadata": {
        "id": "_zGWVy8XmiKi"
      },
      "execution_count": 9,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "df$Risk <- ifelse(df$Slop.Degrees > 20, \"TRUE\", \"FALSE\")\n"
      ],
      "metadata": {
        "id": "d-twK6osmiOE"
      },
      "execution_count": 24,
      "outputs": []
    },
    {
      "cell_type": "code",
      "source": [
        "\n",
        "\n",
        "# Convert target to factor\n",
        "df$Risk <- as.factor(df$Risk)\n",
        "\n",
        "# Remove missing target rows\n",
        "df <- df[!is.na(df$Risk), ]\n",
        "\n",
        "# Drop original landuse type\n",
        "df <- df %>% select(-Landuse_Type)\n",
        "\n",
        "# Dummy encode all categorical predictors\n",
        "dummy_full <- model.matrix(~ ., data = df) %>% as.data.frame()\n",
        "\n",
        "# Remove intercept column if exists\n",
        "dummy_full <- dummy_full %>% select(-`(Intercept)`, everything())\n",
        "\n",
        "# Add Risk target back\n",
        "dummy_full$Risk <- df$Risk\n",
        "\n",
        "# Train-test split\n",
        "set.seed(42)\n",
        "trainIndex <- createDataPartition(dummy_full$Risk, p = 0.8, list = FALSE)\n",
        "train_data <- dummy_full[trainIndex, ]\n",
        "test_data  <- dummy_full[-trainIndex, ]\n",
        "\n",
        "# Separate features and target\n",
        "x_train <- train_data %>% select(-Risk)\n",
        "y_train <- train_data$Risk\n",
        "\n",
        "x_test <- test_data %>% select(-Risk)\n",
        "y_test <- test_data$Risk\n",
        "\n",
        "# Train Random Forest\n",
        "model <- randomForest(x = x_train, y = y_train, ntree = 300)\n",
        "\n",
        "# Predictions\n",
        "y_pred <- predict(model, x_test)\n",
        "\n",
        "# Confusion Matrix\n",
        "cm <- table(Actual = y_test, Predicted = y_pred)\n",
        "print(cm)\n",
        "\n",
        "# Heatmap visualization\n",
        "cm_df <- as.data.frame(cm)\n",
        "ggplot(cm_df, aes(Predicted, Actual, fill = Freq)) +\n",
        "  geom_tile(color = \"black\") +\n",
        "  geom_text(aes(label = Freq), color = \"white\", fontface = \"bold\") +\n",
        "  scale_fill_gradient(low = \"lightgreen\", high = \"darkgreen\") +\n",
        "  ggtitle(\"Confusion Matrix (Landslide Risk: TRUE / FALSE)\") +\n",
        "  theme_minimal() +\n",
        "  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n",
        "\n",
        "# Bar Chart for TRUE vs FALSE\n",
        "risk_compare <- data.frame(\n",
        "  Category = c(\"Actual TRUE\", \"Actual FALSE\", \"Predicted TRUE\", \"Predicted FALSE\"),\n",
        "  Count = c(sum(y_test == \"TRUE\"), sum(y_test == \"FALSE\"),\n",
        "            sum(y_pred == \"TRUE\"), sum(y_pred == \"FALSE\"))\n",
        ")\n",
        "\n",
        "ggplot(risk_compare, aes(x = Category, y = Count, fill = Category)) +\n",
        "  geom_bar(stat = \"identity\") +\n",
        "  ggtitle(\"Risk Category Distribution (Actual vs Predicted)\") +\n",
        "  theme_minimal() +\n",
        "  theme(axis.text.x = element_text(angle = 45, hjust = 1))\n"
      ],
